// App.js
import React from 'react';
import './App.css';
import { BrowserRouter as Router, Route } from 'react-router-dom'; // Import Route from react-router-dom
import Navbar from './Imported_components/Navbar';
import Footer from './Imported_components/Footer';
import Home from './Imported_components/Home';
import Login from './Imported_components/Login'; // Import your Login component
import Registration from './Imported_components/Registration'; // Import your Registration component

function App() {
  return (
    <Router>
      <div className="App">
        <Navbar />
        <Route path="/login" component={Login} />
        <Route path="/registration" component={Registration} />
        <Route path="/" exact component={Home} />
        <Footer />
      </div>
    </Router>
  );
}

export default App;
